    [],nt"num_tags": 0,nt"name": "cencal-baseline-offshore-baseline-for-central-california-generated-to-calculate-shoreline-chan",nt"isopen":
    false,nt"url": null,nt"notes": "Rates of long-term and short-term shoreline
    change were generated in a GIS using the Digital Shoreline Analysis System (DSAS)
    version 3.0; An ArcGIS extension for calculating shoreline change: U.S. Geological
    Survey Open-File Report 2005-1304, Thieler, E.R., Himmelstoss, E.A., Zichichi, J.L.,
    and Miller, T.M. The extension is designed to efficiently lead a user through the
    major steps of shoreline change analysis. This extension to ArcGIS contains three
    main components that define a baseline, generate orthogonal transects at a user-defined
    separation along the coast, and calculate rates of change (linear regression, endpoint
    rate, average of rates, average of endpoints, jackknife).",nt"owner_org": "bd2cdd5a-4d65-46c0-9937-c8381175f104",nt"extras":
